Twin girl are thought to be the work of the devil. Teenage Twins brings an answer, and explores this belief on every angle.
&quot;The twin sister, Prudence and Hope (Brooke and Taylor Young), connected by a mysterious link, are consumed by the same desires. Simultaneously, they share experiences and pleasures, although they are miles away from each other.

&quot;Teenage Twins will transport you to a land where every caress is multiplied by the magic number two. The chemistry between the twin sisters will captivate your senses, as Prudence and Hope become the centerpieces of a mysterious sexual ritual. Teenage Twins is a guaranteed magical experience.
